import styled from 'styled-components';

export const Container = styled.div`
  width: 100%;
  height: 51px;
  background: rgba(126, 49, 186, 0.8);
  fill: solid;
  box-shadow: 0 1px 1px rgba(0, 0, 0, 0.25);
  opacity: 0.8;
  position: absolute;
`;
